import React from "react";
import Tabs from "react-bootstrap/Tabs";
import Tab from "react-bootstrap/Tab";
import { InfoCard, TitleCard, DataCard } from './sensor';

class TabBrowser extends React.Component {

    render() {

        return (
            <Tabs id="controlled_tab"
                  activeKey={this.props.current_tab_key}
                  onSelect={k => this.props.set_tab_cb(k)}>
                <Tab key="dashboard" eventKey="dashboard" title="Dashboard">
                    <div>Tab 1</div>
                </Tab>
                {this.props.tabs.map(function(tab){
                    return (
                        <Tab key={tab.eventKey} eventKey={tab.eventKey} title={tab.title}>
                            <TitleCard sensor_name={tab.eventKey}
                                       remove_tab_cb={this.props.remove_tab_cb}
                                       tab_id={tab.id}/>
                            <InfoCard sensor_name={tab.eventKey}
                                      remove_tab_cb={this.props.remove_tab_cb}
                                      tab_id={tab.id}/>
                            <DataCard sensor_name={tab.eventKey}/>
                        </Tab>
                    )
                })}
            </Tabs>
        )
    }
}

export { TabBrowser };
